import React, { Component } from 'react';
import { Grid, Image } from 'semantic-ui-react';
import axios from 'axios'

const Detail = (props) => {
    return (
      <Grid>
        <Grid.Column width={4}>
          <Image src='/images/wireframe/image.png' />
        </Grid.Column>
        <Grid.Column width={9}>
          <Image src='/images/wireframe/paragraph.png' />
        </Grid.Column>
    </Grid>
    )
  }

export default Detail;
